/**
 * Get the file extension of a URL
 * @param {string} url
 * @returns
 */
function getFileExtension(url) {
 const parts = url.split(".");
 if (parts.length > 1) {
 return parts.pop().toLowerCase(); // Get the last part and convert to lowercase
 } else {
 return "";
 }
}

